import React, { Component } from 'react';
import './App.css';
import Form from '../components/Form/Form.js';

class App extends Component {
  state = {
    activeForm: 'ent'
  }




  render() {
    return (
      <div className="App">
        <h2>Выберите и заполните форму с реквизитами</h2>
        <Form active={this.state.activeForm} />
      </div>
    );
  };
}

export default App;
